import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import * as ROUTES from './config/router';
import {Home, Browse, SignIn, SignUp} from './pages';
import useAuth, {AuthProvider} from './helpers/useAuth';
import { IsUserRedirect, ProtectedRoute } from './helpers/routes';
//import {HeaderContainer} from './containers/header';


function RouteSite() {

  const {isLogin} = useAuth();

  return (
      <Routes>
        <IsUserRedirect loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_IN}>
          <SignIn />
        </IsUserRedirect>
        <IsUserRedirect loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_UP}>
          <SignUp />
        </IsUserRedirect>
        <ProtectedRoute path={ROUTES.BROWSE}>
          <Browse />
        </ProtectedRoute>
        <IsUserRedirect loggedInPath={ROUTES.BROWSE} path={ROUTES.HOME}>
          <Home />
        </IsUserRedirect>
      </Routes>
  )
}

function App() {

  return (
    <Router>
      <AuthProvider>

      <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_IN}>
          <SignIn />
        </IsUserRedirect>
        <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_UP}>
          <SignUp />
        </IsUserRedirect>
        <ProtectedRoute isLogin={isLogin} path={ROUTES.BROWSE}>
          <Browse />
        </ProtectedRoute>
        <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.HOME}>
          <Home />
        </IsUserRedirect>

      </AuthProvider>
      </Router>

  );
}



export default App;
